Bika ambon punika satunggaling jinis kue utawi dhaharan ingkang asalipun saking Indonesia. Kue kasebat dipundamel saking bahan-bahan kados déné endhog/tigan, gula lan santen. Bika ambon punika limrahipun dipunsadé kanthi rasa pandan. Nanging samenika sampun wonten varian rasa sanèsipun kados déné ngginakaken rasa duren, keju, lan coklat. Bika ambon limrahipun saged awet saé kirang langkung sekawan dinten, amargi bibar punika kuwé kasebat lajeng dados sansaya atos.
Miturut andharan saking M Muhar Omtatok, satunggaling budayawan lan sejawaran, kuwé bika ambon punika pikantuk inspirasi saking kuwé ingkang khas saking Melayu inggih punika Bika utawi Bingka. Salejengipun dipundamel modifikasi kaliyan bahan pangembang ingkang wujud nira (tuak enau) dumugi saged dados gronggongan-gronggongan lan bènten kaliyan kuwé bika utawi bingka khas saking Melayu wau. salajengipun piyambakipun ngandharaken bilih kuwé kasebat dipunwatani bika ambon amargi ingkang sapisan dipunsadé lan kondhang wonten ing simpang margi Ambon-Sei Kera Medan.
Bika ambon punika dipunmangertosi minangka angsal-angsal khas saking kutha Medan, Sumatra Lor. Wonten ing Medan, Margi Mojopahit ing wewengkon Medan Petisah punika wonten sekedhikipun 30 toko ingkang nyadé kuwé punika. Saben toko ing papan kasebat saged nyadé langkung saking 1.000 bungkus bika ambon ing saben dintenipun menawi badhé ngancik dinten riyaya. Dipunprakirakaken, sebatan bika ambon punika medal saking kebiasaan masyarakat ingkang rumiyin nembé tepang kaliyan bika ingkang dipundamel wonten ing margi Ambon, Medan. Anggènipun nyebat bika ambon samenika dados tradhisi sinandhing kaliyan mekaripun industri dhaharan punika. &lt;ref name="Kontan"&gt;

