Álvaro Borja Morata Martín (; lair 23 Oktober 1992) inggih punika satunggaling juru main bal-balan saking Spanyol ingkang main ing posisi panyerang utawi "striker" ing klub Liga Primer Inggris klub Chelsea lan Tim Nasional Bal Spanyol. Piyambakipun miwiti karir ing klub Real Madrid, debut ing tim senior taun 2010 lan main ping 52 tetandhingan 11 gol, naté menangaken juwara Liga Champions taun 2014. Piyambakipun pindhah dhateng klub Juventus kanthi regi transfer 20 yuta euro ing taun 2014. Ing klub punika Morata menangaken kalih titel juwara Juwara Serie A lan Coppa Italia. Morata wangsul malih dhateng klub Real Madrid kanthi regi transfer 30 yuta euro. Ing Real Madrid Morata menangaken juwara La Liga taun 2016-2017 lan Liga Champions 2016-2017 sadèrèngipun pindhah dhateng klub Chelsea ing taun 2017 kanthi regi transfer 58 yuta euro. Karir internasional Morata ing tim nasional Spanyol dipunwiwiti wekdal main ing Piala Donya U-17 ing Nigeria lan nyithak kalih gol ing sekawan pertandhingan.
Pranala njawi.
